import React from "react";

function Service(){
    const header ={
        mainHeader: "My Expertise",
        subHeading: "Provide wide Range of Digital Servicess",
    };
    const state = [
        {
            id: 1,
            icon: "./image/four.jpg",
            heading:"UI/UX Design",
            text: "vdyvcdtyvydcdtbgghgcgsdfgcdgcgdfsfcsgcsfgcfgsfcsfcfgsgcfgscf"
        },
        {
            id: 2,
            icon: "./image/four.jpg",
            heading:"UI/UX Design",
            text: "vdyvcdtyvydcdtbgghgcgsdfgcdgcgdfsfcsgcsfgcfgsfcsfcfgsgcfgscf"
        },
        {
            id: 3,
            icon: "./image/four.jpg",
            heading:"UI/UX Design",
            text: "vdyvcdtyvydcdtbgghgcgsdfgcdgcgdfsfcsgcsfgcfgsfcsfcfgsgcfgscf"
        },
        {
            id: 4,
            icon: "./image/four.jpg",
            heading:"UI/UX Design",
            text: "vdyvcdtyvydcdtbgghgcgsdfgcdgcgdfsfcsgcsfgcfgsfcsfcfgsgcfgscf"
        },
        {
            id: 5,
            icon: "./image/four.jpg",
            heading:"UI/UX Design",
            text: "vdyvcdtyvydcdtbgghgcgsdfgcdgcgdfsfcsgcsfgcfgsfcsfcfgsgcfgscf"
        },
    ];

    return (
        <div className="services">
            <div className="container">
                <div className="services_header">
                    <div className="common">
                        <h6 className="heading">{header.mainHeader}</h6> 
                        <h2 className="subheading">{header.subHeading}</h2>
                        <div className="commonBorder"></div>
                    </div>
                    <div className="row bgMain">
                        {state.map((info)=>{
                            <div className="col-4 bgMain">
                                <div className="services_box">
                                    <img src={info.icon} alt="" className="commonIcons" />
                                    <h4 className="services_box-header">{info.heading}</h4>
                                    <p className="services_box-p">{info.text}</p>
                                </div>
                            </div>
                        })}
                    </div>
                </div>
            </div>
        </div>

    )
}
export default Service;
